      out.write("  }); \r\n");
      out.write("  function imgShow(outerdiv, innerdiv, bigimg, _this){ \r\n");
      out.write("    var src = _this.attr(\"src\");//获取当前点击的pimg元素中的src属性 \r\n");
      out.write("    $(bigimg).attr(\"src\", src);//设置#bigimg元素的src属性 \r\n");
      out.write("      /*获取当前点击图片的真实大小，并显示弹出层及大图*/\r\n");
      out.write("    $(\"<img/>\").attr(\"src\", src).load(function(){ \r\n");
      out.write("      var windowW = $(window).width();//获取当前窗口宽度 \r\n");
      out.write("      var windowH = $(window).height();//获取当前窗口高度 \r\n");
      out.write("      var realWidth = this.width;//获取图片真实宽度 \r\n");
      out.write("      var realHeight = this.height;//获取图片真实高度 \r\n");
      out.write("      var imgWidth, imgHeight; \r\n");
      out.write("      var scale = 0.8;//缩放尺寸，当图片真实宽度和高度大于窗口宽度和高度时进行缩放 \r\n");
      out.write("      if(realHeight>windowH*scale) {//判断图片高度 \r\n");
      out.write("        imgHeight = windowH*scale;//如大于窗口高度，图片高度进行缩放 \r\n");
      out.write("        imgWidth = imgHeight/realHeight*realWidth;//等比例缩放宽度 \r\n");
      out.write("        if(imgWidth>windowW*scale) {//如宽度扔大于窗口宽度 \r\n");
      out.write("          imgWidth = windowW*scale;//再对宽度进行缩放 \r\n");
      out.write("        } \r\n");
      out.write("      } else if(realWidth>windowW*scale) {//如图片高度合适，判断图片宽度 \r\n");
      out.write("        imgWidth = windowW*scale;//如大于窗口宽度，图片宽度进行缩放 \r\n");
      out.write("              imgHeight = imgWidth/realWidth*realHeight;//等比例缩放高度 \r\n");
      out.write("      } else {//如果图片真实高度和宽度都符合要求，高宽不变 \r\n");
      out.write("        imgWidth = realWidth; \r\n");
      out.write("        imgHeight = realHeight; \r\n");
      out.write("      } \r\n");
      out.write("          $(bigimg).css(\"width\",imgWidth);//以最终的宽度对图片缩放 \r\n");
      out.write("      var w = (windowW-imgWidth)/2;//计算图片与窗口左边距 \r\n");
      out.write("      var h = (windowH-imgHeight)/2;//计算图片与窗口上边距 \r\n");
      out.write("      $(innerdiv).css({\"top\":h, \"left\":w});//设置#innerdiv的top和left属性 \r\n");
